}    public function index_json()    {        $market = iv('get.market', 'w_', '', 1);        if (empty($market) || !$this->market_list[$market]) {            exit();        }        $market_arr = explode("_", $market);        if (!is_array($market_arr)) {            exit();        }        $xnb = $market_arr[0];        $rmb = $market_arr[1];        $round = $this->coin_list[$xnb]['round'];        $data = [];        foreach ($this->market_list as $k => $v) {            $tmp_xnb = explode("_", $k)[0];            $data['menu'][$k]['price'] = num($v['new_price'], $this->coin_list[$tmp_xnb]['round']);        }        $mymz_trade = new \mymc\trade();        $market_data = $mymz_trade->market_find($market);        if ($market_data) {            $data['top'] = [num($market_data['new_price'], $round), num($market_data['buy_price'], $round), num($market_data['sell_price'], $round), num($market_data['min_price'], $round), num($market_data['max_price'], $round), num($market_data['volume'], (8 - $round)), num($market_data['change'], 2)];        } else {            $data['top'] = [];        }        $buy = $mymz_trade->buy_list($market,50);        $sell = array_reverse($mymz_trade->sell_list($market,50));        while (true) {            if (empty($buy) || empty($sell)) {                break;            }            $b_top = array_shift($buy);            $a_buttom = array_pop($sell);            if ($a_buttom["price"] > $b_top["price"]) {                if (abs(floatval($a_buttom["price"]) - floatval($b_top["price"])) > floatval(1 / pow(10, 7))) {                    $sell[] = $a_buttom;                    array_unshift($buy, $b_top);                    break;                }            }        }        if ($buy) {            foreach ($buy as $k => $v) {                $data['depth']['b'][$k] = [num($v['price'], $round), num($v['nums'], (8 - $round))];            }        } else {            $data['depth']['b'] = 'no';        }        if ($sell) {            foreach ($sell as $k => $v) {                $data['depth']['s'][$k] = [num($v['price'], $round), num($v['nums'], (8 - $round))];            }        } else {            $data['depth']['s'] = 'no';        }        if (session('userid')) {            $trade = db::table("trade")->where(["market" => $market, "userid" => session('userid'), "status" => 0])->order("`id` DESC")->limit(10)->select();            if ($trade) {                foreach ($trade as $k => $v) {                    $data['order'][$k] = [addtime($v['addtime']), $v['type'], num($v['price'], $round), num($v['num'], (8 - $round)), num($v['deal'], (8 - $round)), $v['id'],];                }            }        }        $trade_trade_log = $mymz_trade->log_list($market);        $trade_log = $trade_trade_log;        if (is_array($trade_log) && $trade_log) {            foreach ($trade_log as $k => $v) {                $data['trades'][$k] = [addtime($v['addtime']), $v['type'], num($v['price'], $round), num($v['num'], (8 - $round)), num($v['mum'], (8)),];            }        }        if (session('userid')) {            $user_coin = db::table("user_coin")->where(['userid' => $this->userid])->find();            if ($user_coin) {                $data['finance'] = [$user_coin[$rmb] * 1, $user_coin[$rmb . 'd'] * 1, $user_coin[$xnb] * 1, $user_coin[$xnb . 'd'] * 1,];            }        }        exit(json_encode($data));    }    public function up()    {        $this->check_up('交易');        $paypassword = iv('post.paypassword', 'password', $this->ajax_lang('交易密码格式错误'), 1);        $market = iv('post.market', 'w_', $this->ajax_lang('交易市场格式错误'));        $price = iv('post.price', 'double', $this->ajax_lang('交易价格格式错误'));        $num = iv('post.num', 'double', $this->ajax_lang('交易数量格式错误'));        $type = iv('post.type', 'd', $this->ajax_lang('交易方式格式错误'));        $goole = iv('post.goole', 'd', $this->ajax_lang('谷歌验证码格式错误'), 1);        $user = db::table("user")->where(["id" => $this->userid])->find();        if (defined('Domain') && (Domain == 1)) {            $checkNum = $num * 10;            if (floor($checkNum) != $checkNum) {                $this->ajax('数量小数点位数不能超过一位');            }        }        if (isset($user['trade_sh']) && $user['trade_sh'] == 1) {            ajax($this->ajax_lang('您的账户没有通过审核暂时不能交易'));        }        if ($this->config['mr_index'] != 'd') {            if ($user['tpwdsetting'] == 3) {            }            if ($user['tpwdsetting'] == 2) {                if (!check($paypassword, 'password')) {                    ajax($this->ajax_lang('交易密码格式错误'));                }                if (hashs($paypassword) != $user['paypassword']) {                    ajax($this->ajax_lang('交易密码错误'));                }            }            if ($user['tpwdsetting'] == 1) {                if (!session($user['id'] . 'tpwdsetting')) {                    if (!check($paypassword, 'password')) {                        ajax($this->ajax_lang('交易密码格式错误'));                    }                    if (hashs($paypassword) != $user['paypassword']) {                        ajax($this->ajax_lang('交易密码错误'));                    } else {                        session($user['id'] . 'tpwdsetting', 1);                    }                }            }        }        if ($user['google']) {            $arr = explode('|', $user['google']);            if ($arr[3]) {                $ga = md('user')->google();                if (!$ga->verifyCode($arr[0], $goole, 1)) {                    ajax($this->ajax_lang('谷歌验证失败'));                }            }        }        $res = md('trade')->guadan($this->userid, $market, $price, $num, $type);        if (isset($res[1])) {            $mymz_trade = new \mymc\trade();            $mymz_trade->clear_mr($market);            mc('ajax_index_b_trends', null);            ajax($res[0], 1);        } else {            ajax($res[0]);        }    } 