round']);        }        $mymz_trade = new \mymc\trade();        $market_data = $mymz_trade->market_find($market);        $data['top'] = [num($market_data['new_price'], $round), num($market_data['buy_price'], $round), num($market_data['sell_price'], $round), num($market_data['min_price'], $round), num($market_data['max_price'], $round), num($market_data['volume'], (8 - $round)), num($market_data['change'], 2)];        $buy = $mymz_trade->buy_list($market, 20);        $sell = array_reverse($mymz_trade->sell_list($market, 20));        while (true) {            if (empty($buy) || empty($sell)) {                break;            }            $b_top = array_shift($buy);            $a_buttom = array_pop($sell);            if ($a_buttom["price"] > $b_top["price"]) {                if (abs(floatval($a_buttom["price"]) - floatval($b_top["price"])) > floatval(1 / pow(10, 7))) {                    $sell[] = $a_buttom;                    array_unshift($buy, $b_top);                    break;                }            }        }        foreach ($buy as $k => $v) {            $data['buy'][$k] = [num($v['price'], $round), num($v['nums'], (8 - $round))];        }        foreach ($sell as $k => $v) {            $data['sell'][$k] = [num($v['price'], $round), num($v['nums'], (8 - $round))];        }        if (session('userid')) {            $trade = db::table("trade")->where(["market" => $market, "userid" => session('userid'), "status" => 0])->order("`id` DESC")->limit(10)->select();            if ($trade) {                foreach ($trade as $k => $v) {                    $data['order'][$k] = [addtime($v['addtime']), $v['type'], num($v['price'], $round), num($v['num'], (8 - $round)), num($v['deal'], (8 - $round)), $v['id'],];                }            }            $user = db::table("user")->where(["id" => session('userid')])->find();            $user_coin = db::table("user_coin")->where(['userid' => $this->userid])->find();            if ($user_coin) {                $data['finance'] = [$user_coin[$rmb] * 1, $user_coin[$rmb . 'd'] * 1, $user_coin[$xnb] * 1, $user_coin[$xnb . 'd'] * 1, $user['zzc'] * 1,];            }        }        $trade_log = $mymz_trade->log_list($market);        if ($trade_log) {            foreach ($trade_log as $k => $v) {                $data['log'][$k] = [$v['addtime'] * 1000, $v['type'], num($v['price'], $round), num($v['num'], (8 - $round)), num($v['mum'], (8)),];            }        }        exit(json_encode($data));    }    public function specialty()    {        $market = iv('get.market', 'w_', '', 1);        $this->assign('market', $market);        $this->display();    }    public function getMarketSpecialtyJson()    {        $market = iv('get.market', 'w_', '', 1);        $step = iv('get.step', 'd', '', 1);        $timearr = [1, 3, 5, 10, 15, 30, 60, 120, 240, 360, 720, 1440, 10080];        if (in_array($step / 60, $timearr)) {            $time = $step / 60;        } else {            $time = 5;        }        $tradeJson = md('trade')->json_list($market, $time, 500);;        $json_data = [];        foreach ($tradeJson as $k => $v) {            $json_data[] = json_decode($v['data'], true);        }        $data = [];        foreach ($json_data as $k => $v) {            $data[$k][0] = $v[0];            $data[$k][1] = 0;            $data[$k][2] = 0;            $data[$k][3] = $v[2];            $data[$k][4] = $v[5];            $data[$k][5] = $v[3];            $data[$k][6] = $v[4];            $data[$k][7] = $v[1];        }        ksort($data);        foreach ($data as $key => $value) {            $id[$key] = $value[0];        }        array_multisort($id, SORT_STRING, SORT_ASC, $data);        exit(json_encode($data));    }    public function getSpecialtyTrades()    {        $market = iv('get.market', 'w_', '', 1);        $since = iv('get.since', 'd', '', 1);        $json_data = [];        if (!$since) {            $tr